import React from "react";
import MainSectionOne from "./MainSectionOne";
import MainSectionTwo from "./MainSectionTwo";

export default function Main(props) {
  return (
    <div className="main">
      <MainSectionOne
        name={props.name}
        title={props.title}
        cell={props.cell}
        email={props.email}
        linkedin={props.linkedin}
      />
      <MainSectionTwo />
    </div>
  );
}
